import React, { Component } from "react";
import GeneralInfo from "./GeneralInfo";
import Title from "./Title";
import Education from "./Education";
import Experience from "./Experience";

class Preview extends Component {
  render() {
    const { firstName, lastName, mail, phone } = this.props.state.generalInfo;
    const { school, subject } = this.props.state.education;
    const startEducation = this.props.state.education.from;
    const endEducation = this.props.state.education.to;
    const educationCity = this.state.education.city;
    const { edit } = this.props.state;
    const { position, company } = this.props.state.experience;
    const experienceCity = this.props.state.experience.city;
    const startExperience = this.props.state.experience.from;
    const endExperience = this.props.state.experience.to;
    return (
        <div>
            <Title />
            <GeneralInfo edit={edit} firstName={firstName} lastName={lastName} mail={mail} phone={phone}/>
            <Education edit={edit} school={school} city={educationCity} subject={subject} from={startEducation} to={endEducation} />
            <Experience edit={edit} position={position} company={company} city={experienceCity} from={startExperience} to={endExperience}/>
        </div>
    )
  }  
}

export default Preview;
